import React, { Component } from 'react';
import './Card.sass';
import SimpleButton from '../SimpleButton/SimpleButton';

class Card extends Component {
  render() {
    return (
        <div className="card">
          <h3 className="card__title">Green cat - сайт защиты природы</h3>
          <h4 className="card__subtitle">Участники:</h4>
          
          <div className="card__members">
            <div className="member">
              <a href="#" className="member__img">O</a>

              <h5 className="member__name"><a href="#">Олежа дебилкин</a></h5>
            </div>

            <div className="member">
              <a href="#" className="member__img">O</a>

              <h5 className="member__name"><a href="#">вы</a></h5>
            </div>
          </div>

          <div className="card__buttons">
            <SimpleButton theme="mint">Открыть</SimpleButton>
            <SimpleButton>Добавить участника</SimpleButton>
          </div>
        </div>
    );
  }
}

export default Card;
